import React from 'react';
import './App.css';

function Navbar() {
    return(
        <div className = 'Navbar'>
            <h1>Mobolaji Rotibi</h1>
            <ul>
            <li><a href = "/"><h2>Projects</h2></a></li>
            <li><a href = "/"><h2>Resume</h2></a></li>
            </ul>
            <hr/>
        </div>
    );
};

export default Navbar;
